using namespace stappler;

#define HELP_STRING \
	"pathgen\n" \

int parseOptionSwitch(data::Value &ret, char c, const char *str) {
	if (c == 'h') {
		ret.setBool(true, "help");
	}
	return 1;
}

int parseOptionString(data::Value &ret, const String &str, int argc, const char * argv[]) {
	if (str == "help") {
		ret.setBool(true, "help");
	}
	return 1;
}

void sp_android_terminate () {
	stappler::log::text("Exception", "Crash on exceprion");
  __gnu_cxx::__verbose_terminate_handler();
}

int _spMain(argc, argv) {
	std::set_terminate(sp_android_terminate);

	data::Value opts = data::parseCommandLineOptions(argc, argv, &parseOptionSwitch, &parseOptionString);
	if (opts.getBool("help")) {
		std::cout << HELP_STRING << "\n";
		return 0;
	};

	Vector<size_t> sizes;

	for (auto &it: stappler::app::s_iconSources) {
		layout::Path path;
		if (it.second.compare(0, 7, "path://") == 0) {
			path.init(it.second.substr(7));
			auto bytes = path.encode();
			sizes.push_back(bytes.size());
			auto text = base16::encode(CoderSource(bytes));
			auto d = text.c_str();
			bool first = false;
			std::cout << "static const uint8_t s_icon_" << it.first << "[] = { ";
			for (size_t i = 0; i < text.size() / 2; ++ i) {
				if (!first) {
					first = true;
				} else {
					std::cout << ",";
				}
				std::cout << "0x" << d[i * 2] << d[i * 2 + 1];
			}
			std::cout << "};\n";
			//std::cout <<"	std::make_pair(\"" << it.first << "\",  " << path.commandsCount() << path.dataCount() << text << "\n";
		} else {
			std::cout << "Icon Failed: " << it.second << "\n";
		}
	}

	std::cout << "static struct IconDataStruct { IconName name; size_t len; const uint8_t *data; } s_iconTable["
			<< stappler::app::s_iconSources.size() << "] = {\n";

	size_t i = 0;
	for (auto &it: stappler::app::s_iconSources) {
		String name = it.first;
		name[0] = toupper(name[0]);
		auto s = name.find("_ic_");
		if (s != String::npos) {
			name.erase(s, 3);
		}
		std::cout << "\t{ IconName::" << name << ", " << sizes[i] << ", s_icon_" << it.first << " },\n";
		++ i;
	}

	std::cout << "};\n\nstatic uint16_t s_iconCount = " << stappler::app::s_iconSources.size() << ";\n";

	std::cout <<
R"Text(enum class IconName : uint16_t {
	None = 0,
	Empty,

	Dynamic_Navigation,
	Dynamic_Loader,
)Text";
	for (auto &it: stappler::app::s_iconSources) {
		String name = it.first;
		name[0] = toupper(name[0]);
		auto s = name.find("_ic_");
		if (s != String::npos) {
			name.erase(s, 3);
		}
		std::cout << "\t" << name << ",\n";
	}

	std::cout << "};";

	return 0;
}
